import React from 'react';

import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

import './../style/ImageUpload.css';

export default () => {
    return (
        <Container>
            <Row lg={1}>
                <Col>
                    <div className='image-placeholder large-holder'>Upload</div>
                </Col>
            </Row>
            <Row>
                <Col>
                    <div className='image-placeholder small-holder'>Upload</div>
                </Col>
                <Col>
                    <div className='image-placeholder small-holder'>Upload</div>
                </Col>
            </Row>
            <Row>
                <Col>
                    <div className='image-placeholder small-holder'>Upload</div>
                </Col>
                <Col>
                    <div className='image-placeholder small-holder'>Upload</div>
                </Col>
            </Row>
        </Container>
    );
};
